import React from 'react';
import {
  Box,
  AppBar,
  Toolbar,
  Typography,
  Button,
  Container,
} from '@mui/material';
import { getCurrentClientConfig } from '../../config/clientConfig';

interface CleanLayoutProps {
  children: React.ReactNode;
}

const CleanLayout: React.FC<CleanLayoutProps> = ({ children }) => {
  const clientConfig = getCurrentClientConfig();

  return (
    <Box sx={{ minHeight: '100vh', bgcolor: '#fafafa' }}>
      {/* Top Navigation */}
      <AppBar 
        position="static" 
        elevation={0}
        sx={{ 
          bgcolor: 'white',
          borderBottom: '1px solid #e5e7eb'
        }}
      >
        <Container maxWidth="xl">
          <Toolbar sx={{ px: 0, py: 1 }}>
            {/* Logo Section */}
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <Box
                  component="img"
                  src={clientConfig.clientLogo}
                  alt="Client Logo"
                  sx={{
                    height: 32,
                    width: 'auto',
                    maxWidth: 120,
                    objectFit: 'contain'
                  }}
                  onError={(e) => {
                    e.currentTarget.style.display = 'none';
                  }}
                />
                <Typography sx={{ color: '#9ca3af', mx: 1 }}>|</Typography>
                <Box
                  component="img"
                  src={clientConfig.myLogo}
                  alt="My Logo"
                  sx={{
                    height: 28,
                    width: 'auto',
                    maxWidth: 100,
                    objectFit: 'contain'
                  }}
                  onError={(e) => {
                    e.currentTarget.style.display = 'none';
                  }}
                />
              </Box>
            </Box>

            {/* Navigation Menu */}
            <Box sx={{ flexGrow: 1, display: 'flex', justifyContent: 'center' }}>
              <Box sx={{ display: 'flex', gap: 4 }}>
                <Button 
                  sx={{ 
                    color: '#374151', 
                    textTransform: 'none',
                    fontWeight: 500,
                    '&:hover': { bgcolor: 'transparent', color: clientConfig.primaryColor }
                  }}
                >
                  Features
                </Button>
                <Button 
                  sx={{ 
                    color: '#374151', 
                    textTransform: 'none',
                    fontWeight: 500,
                    '&:hover': { bgcolor: 'transparent', color: clientConfig.primaryColor }
                  }}
                >
                  Documents
                </Button>
                <Button 
                  sx={{ 
                    color: '#374151', 
                    textTransform: 'none',
                    fontWeight: 500,
                    '&:hover': { bgcolor: 'transparent', color: clientConfig.primaryColor }
                  }}
                >
                  Search
                </Button>
                <Button 
                  sx={{ 
                    color: '#374151', 
                    textTransform: 'none',
                    fontWeight: 500,
                    '&:hover': { bgcolor: 'transparent', color: clientConfig.primaryColor }
                  }}
                >
                  Analytics
                </Button>
              </Box>
            </Box>

            {/* Right Actions */}
            <Box sx={{ display: 'flex', gap: 2 }}>
              <Button
                variant="outlined"
                sx={{
                  textTransform: 'none',
                  borderColor: '#d1d5db',
                  color: '#374151',
                  '&:hover': {
                    borderColor: clientConfig.primaryColor,
                    bgcolor: 'transparent'
                  }
                }}
              >
                Sign In
              </Button>
              <Button
                variant="contained"
                sx={{
                  textTransform: 'none',
                  bgcolor: clientConfig.primaryColor,
                  '&:hover': {
                    bgcolor: clientConfig.primaryColor,
                    opacity: 0.9
                  },
                  boxShadow: 'none'
                }}
              >
                Get Started
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      {/* Main Content */}
      <Box
        sx={{
          minHeight: 'calc(100vh - 80px)',
          backgroundImage: clientConfig.backgroundImage ? `url(${clientConfig.backgroundImage})` : 'none',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundRepeat: 'no-repeat',
        }}
      >
        {children}
      </Box>
    </Box>
  );
};

export default CleanLayout;
